import React from "react";

export default class ListWidgetComponent extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            elements: false,
        }
    }

    componentDidMount() {
        this.setState({
            elements: true
        })
    }

    render() {
        return(
            <span>
                {this.props.msg}
            </span>
        );
    }
};
